import React from 'react';

export function Circle(props) {
    return (
        <div className="circle" onPointerDown={props.onPointerDown} style={{ backgroundColor: props.color, color: props.textColor, borderColor: props.borderColor, borderWidth: "2px", borderStyle: "solid", boxSizing: "border-box"}}>{props.value}</div>
    );
}
